import Vue from "vue";
import axios from "axios";
import BootstrapVue from 'bootstrap-vue';
import 'bootstrap/dist/css/bootstrap.css';
import 'bootstrap-vue/dist/bootstrap-vue.css';
// import responsive from "vue-responsive";
// var responsive = require('./vue-responsive');
Vue.use(BootstrapVue)

export default Vue.extend({
  name: "books",
  props: {},
  data() {
    return {
      middleSize: ['hidden-all','lg','xl'],
      items: [],
      fields: [
        {
          key: 'title',
          label: 'Title',
          sortable: true,

        },
        {
          key: 'authors',
          label: 'Authors',
          sortable: true,
        },
        {
          key: 'language',
          sortable: false,
        },
        {
          key: 'pageCount',
          label: 'Pages',
          sortable: true
        },
        {
          key: "previewLink",
          label: 'Link',
          sortable: false,
        },
      ],
      bookName: "quit",
      baseURL: 'https://www.googleapis.com/books/v1/volumes?q='
    };
  },
  mounted() {
    //Make an array of the data objects
    axios.get(this.baseURL + this.bookName).then(
      result => {
        for (var index = 0; index < result.data.items.length; index++) {
          Vue.set(this.items, index, result.data.items[index].volumeInfo);
        }
      },
      error => {
        console.error(error);
      }
    );
  },
  methods: {
  }
});
